import HeartRateService from './services/HeartRateService';

function App() {

  let heartRates = "";

  const handleSubmit = async () => {
    event.preventDefault;
    heartRates = await HeartRateService.getAllHeartRates();
  }

  return (
    <div className="App">
      Hello
      <button type="submit" onClick={handleSubmit}></button>
      {heartRates}
    </div>
  );
}

export default App;
